import React from 'react';
import { bin, edit } from './data';
import { moneyFormat } from '../../../utilities/helpers'

export default (props) => {
  const { index, img, title, price, onDelete, onEdit } = props;
  return (
    <div className={["u-row space-between no-border", index === 0 ? "no-border" : "horizon"].join(' ')}>
      <div className="u-row">
        <div className="u-list-img">
          <img
            style={{ height: '100%', borderRadius: 10 }}
            src={img}
          />
        </div>
        <div className="u-list-text">
          <div>{title}</div>
          <div className="u-list-textsmall">Starting from</div>
          <div className="u-cyan">{moneyFormat(price)}</div>
        </div>
      </div>
      <div className="u-row" style={{ width: '20%', justifyContent: 'flex-end', alignSelf: 'flex-start' }}>
        <img style={{ marginLeft: 30, cursor: 'pointer' }} width="20px" src={edit} onClick={onEdit} />
        <img style={{ marginLeft: 30, cursor: 'pointer' }} width="20px" src={bin} onClick={onDelete} />
      </div>
    </div>
  )
}
